import React from 'react';
import "./Navbar.css";
import logo from "./comarca-logo-ok.png"

//BOOTSTRAP
import "bootstrap/dist/css/bootstrap.min.css";

import { Navbar, Nav, Button } from 'react-bootstrap';


function navbar({item1, item2, item3}) {
    return (
        <Navbar expand="lg" className="nav-container" style={{margin: "0", backgroundColor: ""}}>
            <Navbar.Brand href="index.html"><img className="nav-logo" src={logo} alt="comarca de creadores logo" /></Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                    <Nav.Link href="#link"> {item1} </Nav.Link>
                    <Nav.Link href="#link"> {item2} </Nav.Link>
                    <Nav.Link href="#link"> {item3} </Nav.Link>
                </Nav>
                <Button id="cart-button" className="cart-button" style={{backgroundColor:"#c59534", margin: "5%", outline:"0", border: "none"}}><i class="fas fa-shopping-cart"></i></Button> 
            </Navbar.Collapse>
        </Navbar>
    );
};

export default navbar;
